      string: '{"id":389,"page":1,"results":[{"author":"Andres Gomez","author_details":{"name":"Andres
        Gomez","username":"tanty","avatar_path":"/https://secure.gravatar.com/avatar/03a53cd53b8254fe582d4fe1acc26c4e.jpg","rating":10.0},"content":"Master
        piece. Fantastic script and evolution of the characters.","created_at":"2013-05-13T15:41:51.562Z","id":"519109bf19c29548540227d6","updated_at":"2021-06-23T15:57:21.378Z","url":"https://www.themoviedb.org/review/519109bf19c29548540227d6"},{"author":"John
        Chard","author_details":{"name":"","username":"John Chard","avatar_path":"/utEXl2EDiXBK6f41wCLsvprvMg4.jpg","rating":9.0},"content":"Unlikely,
        but it is possible.\r\n\r\n12 Angry Men is directed by Sidney Lumet and adapted
        from a teleplay of the same name by Reginald Rose. The cast is headed by Henry
        Fonda and Lee J. Cobb. The film tells the story of a jury made up of 12 men
        as they deliberate the guilt or innocence of a defendant on the basis of reasonable
        doubt. Except for two short scenes at the beginning and end of the film, it''s
        filmed entirely on one set, that of the jury deliberation room.\r\n\r\nSweaty,
        gritty, claustrophobic - all words that sit snugly in the context of Lumet''s
        excellently crafted deconstruction of 12 men trying to arrive at one verdict
        in the case of a Puerto Rican youth on trial for the murder of his father.
        The evidence appears overwhelming, there''s witnesses, a murder weapon and
        motive, the boy is surely on his way to the electric chair. 11 of the men
        are convinced he''s guilty, only one man stands alone, Henry Fonda''s juror
        number 8, who refuses to turn in a vote of guilty until the evidence and facts
        are discussed at length. As the others rail against him and tempers get frayed,
        juror number 8 prompts the others to examine their own prejudices and commitment
        to justice.\r\n\r\nA lesson in tight direction and editing, and with performances
        to match, 12 Angry Men is quite simply not to be missed by those seeking to
        venture into classic cinema. 9/10","created_at":"2020-03-29T14:56:48.949Z","id":"5e80b7301d6c5f00141d8798","updated_at":"2021-06-23T15:58:35.983Z","url":"https://www.themoviedb.org/review/5e80b7301d6c5f00141d8798"},{"author":"barrymost","author_details":{"name":"","username":"barrymost","avatar_path":"/ibbLLFhqCRY4Dh37WoBGMHSCThT.jpg","rating":10.0},"content":"Jurors:\r\n\r\nMartin
        Balsam\r\n\r\nJohn Fiedler\r\n\r\nLee J. Cobb\r\n\r\nE.G. Marshall\r\n\r\nJack
        Klugman\r\n\r\nEdward Binns\r\n\r\nJack Warden\r\n\r\nHenry Fonda\r\n\r\nJoseph
        Sweeney\r\n\r\nEd Begley\r\n\r\nGeorge Voskovec\r\n\r\nRobert Webber\r\n\r\n12
        jurors deliberate on the guilt or innocence of a young Spanish-American man
        accused of murdering his father. As the moments tick by, the discussion becomes
        an expose of each individual man''s thoughts, feelings, prejudices, and secrets.\r\n\r\nThis
        is Fonda at his best, backed up with excellent support from all 11 of his
        fellow jurors. Lee J. Cobb is also a standout.\r\n\r\nCrackling script by
        Reginald Rose, with superb direction by Sidney Lumet.  Full of memorable moments
        and great dialogue and character development; this is one of the greatest
        courtroom dramas this reviewer has ever seen.","created_at":"2021-12-06T15:56:24.222Z","id":"61ae32a80d2f53001cd78752","updated_at":"2021-12-06T15:56:24.222Z","url":"https://www.themoviedb.org/review/61ae32a80d2f53001cd78752"}],"total_pages":1,"total_results":3}'
